	add("anachronism", "{\"term\":\"anachronism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027anachronismus\u0027 from Ancient greek (to 1453) \u0027ἀναχρονισμός\u0027 from \u0027ἀναχρονίζομαι\u0027 (referring to the wrong time) from \u0027ἀνά\u0027 (up against) + \u0027χρονίζω\u0027 (spending time) which from \u0027χρόνος\u0027 (time)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chronological mistake; the erroneous dating of an event, circumstance, or object\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person or thing which seems to belong to a different time or period of time\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1956\u0027\u0027, w:Arthur C. Arthur C. Clarke, \u0027The City and the Stars\u0027, page 32\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"His movements, his clothes, everything about him, seemed slightly out of place in this assembly. He spoiled the pattern; like Alvin, he was an \u0027\u0027anachronism\", \"priority\":4}]}, \"synonyms\":{}}");

	add("anaclisis", "{\"term\":\"anaclisis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) ἀνακλίνω (\u0027anaklino\u0027, \u0026quot;to lean against, to lean upon\u0026quot;). The term entered the English language as a translation for the German psychoanalytic term \u0027Anlehnung\u0027. (In English translations, a Greek word was used to be more scientific.)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The choice of an object of libidinal attachment on the basis of a resemblance to early childhood protective and parental figures\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anaconda", "{\"term\":\"anaconda\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Sinhalese\"], \"text\":\"From the Sinhalese \u0027හෙනකඳයා\u0027 (one with large body) a species of constrictor found in Sri Lanka.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Eunectes thumb|right|A Green \u0027\u0027Anaconda\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of various large nonvenomous snakes of the genus \u0027Eunectes\u0027, found mainly in northern South America. Their length can grow to as much as 5 m (15 ft\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Penis\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, \u0026quot;\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"My \u0027\u0027anaconda\u0027\u0027 don\u0027t want none / Unless you got buns, ho\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Eric Jerome Dickey, \u0027Liar\u0027s Game\u0027, Signet (2002), ISBN 9781101142998, [http://books.google.com/books?id\u003dtNEt08nxVykC\u0026amp;pg\u003dPT153 unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Womack went into the bedroom and checked on his two boys. When I headed to the bathroom to drain my \u0027\u0027anaconda\u0027\u0027, I caught a profile of him standing in the doorway, smiling down on the little rascals\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Christopher Darrick Odom, \u0027Visa Versa: Black Men Suffer in the Dating Game Too!\u0027, iUniverse (2006), ISBN 9780595403516, [http://books.google.com/books?id\u003dTPDPGdfg-5sC\u0026amp;pg\u003dPR11 page xi\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"I have chased after white women to find they only wanted to dance with my \u0027\u0027anaconda\u0027\u0027 and weren\u0027t interested in me as a partner\", \"priority\":9}]}, \"synonyms\":{}}");

