	add("anacrusis", "{\"term\":\"anacrusis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Modern Latin from Ancient greek (to 1453) \u0027lang\u003dgrc|ἀνάκρουσις\u0027 () from \u0027lang\u003dgrc|ἀνακρούω\u0027 () from \u0027ἀνά\u0027 (up) + \u0027lang\u003dgrc|κρούω\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|Beginning of BWV 736, with an anacrusi shown in red\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An unstressed syllable at the start of a verse\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An unstressed note or notes before the first strong beat (or downbeat) of a phrase\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, \u0027Any Old Iron\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Then Etheridge poised his baton, jerked an upbeat, and made the violinists speak the low G and A of their \u0027\u0027anacrusis\", \"priority\":5}]}, \"synonyms\":{}}");

	add("anadem", "{\"term\":\"anadem\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027anadema\u0027 from Ancient greek (to 1453) \u0027αναδεμα\u0027 (head-band)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A headband, especially a garland of flowers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, Vladimir Nabokov, \u0027Ada or Ardor\u0027, Penguin 2011, p. 67\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Ada, on the grass, kept trying to make an \u0027\u0027anadem\u0027\u0027 of marguerites for the dog while Lucette looked on, munching a crumpet\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, Stephen Donaldson, \u0027The Illearth War\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As she held high the Staff, she caught the early sunlight. Her hair shone about her like an \u0027\u0027anadem\u0027\u0027, and the golden Ranyhyn bore her up like an offering to the wide day\", \"priority\":5}]}, \"synonyms\":{}}");

	add("anadrome", "{\"term\":\"anadrome\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) ανα \u0027(backwards)\u0027 + \u0027-drome\u0027 \u0026quot;course\u0026quot;, \u0026quot;road\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word which forms a different word when spelled backwards\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;desserts\u0026quot; and \u0026quot;stressed\u0026quot; are believed to be the longest common English \u0027\u0027anadromes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An anadromous fish\", \"priority\":3}]}, \"synonyms\":{}}");

