	add("anaesthesia", "{\"term\":\"anaesthesia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{prefix|an|aesthesia|lang\u003den}}, from Ancient greek (to 1453) \u0027ἀναισθησία\u0027 from \u0027ἀν-|sc\u003dpolytonic\u0027 (not) with \u0027αἴσθησις|sc\u003dpolytonic\u0027 (sensation) Coined in 1846 {{C.E.}} by {{w|Oliver Wendell Holmes, Sr.}}, in a letter to dentist {{w|William T. G. Morton}}, the first practitioner to publicly demonstrate the use of w:diethyl ether|ether during surgery, writing::: Everybody wants to have a hand in a great discovery. All I will do is to give a hint or two as to names\u0026amp;mdash;or the name\u0026amp;mdash;to be applied to the state produced and the agent. The state should, I think, be called ‘\u0027\u0027Anaesthesia\u0027\u0027.’ This signifies insensibility\u0026amp;mdash;more particularly\u0026amp;nbsp;... to objects of touch.\u0026lt;ref\u0026gt;Small, Miriam Rossiter (1962). Oliver Wendell Homes. Twayne’s United States authors series, 29. New York: Twayne Publishers. OCLC 273508, p. 55\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A method of preventing sensation, used to eliminate pain\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Loss or prevention of pain, as caused by anesthesia\", \"priority\":2}]}, \"synonyms\":{}}");

