	add("anagenesis", "{\"term\":\"anagenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|ana|genesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The evolution of a new species by the large scale change in gene frequency so that the new species replaces the old rather than branching to produce an additional species\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anagoge", "{\"term\":\"anagoge\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin {{m|la|anagōgē}}, from Ancient greek (to 1453) \u0027ἀναγωγή\u0027 (elevation)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The spiritual or mystical interpretation of a word or passage beyond the literal, allegorical or moral sense (especially in Biblical criticism\", \"priority\":1}]}, \"synonyms\":{}}");

