	add("anagram", "{\"term\":\"anagram\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"Late 16th century, from French \u0027anagramme\u0027 formed on Greek \u0027ἀνά\u0027 (up, back) + \u0027γράμμα\u0027 (letter)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word or phrase that is created by rearranging the letters of another word or phrase\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The word \u0026quot;silent\u0026quot; is an \u0027\u0027anagram\u0027\u0027 of \u0026quot;listen\u0026quot\", \"priority\":2}]}, \"synonyms\":{}}");

