	add("analgesic", "{\"term\":\"analgesic\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027analgesia\u0027 () from from Ancient greek (to 1453) \u0027ἀν-\u0027 (sc\u003dpolytonic) + \u0027ἄλγησις\u0027 (sc\u003dpolytonic) from \u0027ἄλγος\u0027 (sc\u003dpolytonic)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any medicine, such as aspirin, that reduces pain without inducing unconsciousness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Jocoby, David B. and Youngson, R. M., \u0027Encyclopedia of Family Health\u0027, Marshall Cavendish, [http://books.google.com/books?id\u003d3F8Q1dDZw7MC\u0026amp;pg\u003dPA137\u0026amp;dq\u003danalgesic\u0026amp;hl\u003den\u0026amp;ei\u003dX4A3TI7WBoL68Abx2dimBg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d8\u0026amp;ved\u003d0CE0Q6AEwBzg\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003danalgesic\u0026amp;f\u003dfalse pg. 137\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I am taking an \u0027\u0027analgesic\u0027\u0027. Is it safe to drink alcholic beverages\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Associated Press staff, \u0027[http://www.webcitation.org/5r6KG0nPp Cadence signs option to buy Incline]\u0027 ([http://www.businessweek.com/ap/financialnews/D9GFT6CO0.htm original copy]), Bloomberg Businessweek\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Incline makes Ionsys, a potential \u0027\u0027analgesic\u0027\u0027 for adult inpatients requiring opioid pain treatment after surgery\", \"priority\":6}]}, \"synonyms\":{}}");

	add("analloerotic", "{\"term\":\"analloerotic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|an|alloerotic|gloss1\u003dnot|gloss2\u003dsexual attraction to another person|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"lacking in sexual attraction to people of any gender but not necessarily to onesel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997, Cornelis Dirk Doorn, \u0027Towards a gender identity theory of transsexualism\u0027, Vrije Universiteit, page 7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the asexual or \u0027\u0027analloerotic\u0027\u0027 transsexual autogynephilia does not lead to erotic attractions, either to women or to men\", \"priority\":3}]}, \"synonyms\":{}}");

