	add("analogy", "{\"term\":\"analogy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027analogia\u0027 from Ancient greek (to 1453) \u0027ἀναλογία\u0027 from \u0027ἀνά\u0027 + \u0027λόγος\u0027 (speech, reckoning)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A relationship of resemblance or equivalence between two situations, people, or objects, especially when used as a basis for explanation or extrapolation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1841\u0027\u0027, w: Ralph Waldo Ralph Waldo Emerson, \u0027Essays: First Series\u0027, ch. 6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Yet the systole and diastole of the heart are not without their \u0027\u0027analogy\u0027\u0027 in the ebb and flow of love\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1869\u0027\u0027, w:Charles Charles Dickens, \u0027The Uncommercial Traveller\u0027, ch. 18\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Is there any \u0027\u0027analogy\u0027\u0027, in certain constitutions, between keeping an umbrella up, and keeping the spirits up\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1901\u0027\u0027, w:Edith Edith Wharton, \u0027The Valley of Decision\u0027, ch. 12\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The old \u0027\u0027analogy\u0027\u0027 likening the human mind to an imperfect mirror, which modifies the images it reflects, occurred more than once to Odo\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, \u0026quot;[http://www.time.com/time/magazine/article/0,9171,953636,00.html How to Write Programs],\u0026quot; \u0027Time\u0027, 3 Jan\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Perhaps the easiest way to think of it is in terms of a simple \u0027\u0027analogy\u0027\u0027: hardware is to software as a television set is to the shows that appear on it\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, w:Harlan Harlan Coben, \u0027Gone for Good\u0027, ISBN 9780440236733, [http://books.google.ca/books?id\u003dppjCHXrMa50C\u0026amp;pg\u003dPA75\u0026amp;dq\u003danalogy+subject:%22fiction%22\u0026amp;lr\u003d\u0026amp;as_drrb_is\u003db\u0026amp;as_minm_is\u003d0\u0026amp;as_miny_is\u003d2001\u0026amp;as_maxm_is\u003d0\u0026amp;as_maxy_is\u003d2009\u0026amp;as_brr\u003d3\u0026amp;client\u003dfirefox-a\u0026amp;cd\u003d22\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003danalogy%20subject%3A%22fiction%22\u0026amp;f\u003dfalse p. 75\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A kid living on the street is a bit like — and please pardon the \u0027\u0027analogy\u0027\u0027 here — a weed\", \"priority\":12}]}, \"synonyms\":{}}");

